.draw-map {
    .map-btn-group {
        position: absolute;
        margin-top: 10px;
        z-index: 1;
        margin-left: 20px;
        ul {
            color: black;
            padding: 0 20px;
            height: 40px;
            line-height: 40px;
            background: #ffffff;
            font-size: 18px;
            li {
                cursor: pointer;
                display: inline-block;
            }
        }
    }
    #map-canvas {
        height: 40vh;
    }
    .submit {
        background-color: #20a8d8!important;
        border-color: #20a8d8!important;
    }
    .drawbutton {
        height: 40px;
        background: #ffffff;
        color: black;
        text-align: center;
        line-height: 40px;
        position: absolute;
        z-index: 1;

        margin-top: 10px;
        cursor: pointer;
    }
    .left-button {
        left: 45%;
    }
    .right-button {
        background: rgba(255,255,255,0.8);
        right: 4%;
    }
}
